import React, { useState } from 'react';
import Header from '../components/header';
import Profile from '../components/Profile';
import { useNavigate } from 'react-router-dom';
import { useAuth0 } from '@auth0/auth0-react';

function HomeScreen() {
  const navigate = useNavigate();
  const { isAuthenticated, logout } = useAuth0();
  const [city, setCity] = useState();

  if (!isAuthenticated) {
    navigate('/');
  }

  const onCityChange = (event) => {
    setCity(event.target.value);
  };

  const onSearch = () => {
    navigate(`/weather?city=${city}`);
  };
  return (
    <>
      <Header />
      <div className="flex items-start justify-center mx-auto max-w-screen-md h-screen">
        <div>
          <div className="py-5">
            <Profile />
          </div>
          <div className="mb-6">
            <input
              onChange={onCityChange}
              type="text"
              id="large-input"
              placeholder="City"
              className="block p-4 text-gray-900 border border-gray-300 rounded-lg bg-gray-50 sm:text-md focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500"
            />
            <button
              onClick={onSearch}
              type="submit"
              className="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-lg text-sm w-full sm:w-auto px-5 py-2.5 text-center dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800"
            >
              Submit
            </button>
          </div>
        </div>
      </div>
    </>
  );
}

export default HomeScreen;
